import React, { useState } from 'react'
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import MovieList from './components/MovieList'

const App = () => {
  const [movies, setMovies] = useState([{
    "Title": "Electroma",
    "Year": "2006",
    "imdbID": "tt0800022",
    "Type": "movie",
    "Poster": "https://m.media-amazon.com/images/M/MV5BODcyMTE2NTQxN15BMl5BanBnXkFtZTcwMzkyMjY0MQ@@._V1_SX300.jpg"
  },
  {
    "Title": "A Bronx Tale",
    "Year": "1993",
    "imdbID": "tt0106489",
    "Type": "movie",
    "Poster": "https://m.media-amazon.com/images/M/MV5BMTczOTczNjE3Ml5BMl5BanBnXkFtZTgwODEzMzg5MTI@._V1_SX300.jpg"
  },
  {
    "Title": "Pink Floyd: The Wall",
    "Year": "1982",
    "imdbID": "tt0084503",
    "Type": "movie",
    "Poster": "https://m.media-amazon.com/images/M/MV5BZDhlZTYxOTYtYTk3Ny00ZDljLTk3ZmItZTcxZWU5YTIyYmFkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg"
  }
  ])
  return (
    <>
    <div className="bg container-fluid">
      <div className="row">
        <MovieList movies={movies} />
      </div>
    </div>
    </>
  );
}

export default App;
